deliveryText:
• Услуга доставки доступна не только в Ашхабаде, но и в Бузмейине и Аннау. Услуга бесплатная; 

• Общая стоимость каждого заказа должна быть не менее 50 манатов; 

• После того, как вы сделаете заказ с сайта, вам позвонит оператор и подтвердит заказ (если вы постоянный клиент, ваши заказы также будут автоматически подтверждены по вашему желанию); 

• Услуга предоставляется на основе вашего адреса электронной почты и номера телефона; Убедитесь, что вам позвонили с номера телефона, который вы ввели, чтобы подтвердить заказ. Также проверьте правильность введенного вами адреса; 

• Оплата производится после того, как вы подтвердили заказ. Ваш коносамент указан в коносаменте поставщика. Оплата производится наличными и безналичными в национальной валюте. Товары, которые вы получили и оплатили, не будут возвращены;
